import { useReducer, useState } from "react";
import { useNavigate } from "react-router";
import mystore from "../storeandreducer/store";

// let flag = JSON.parse(localStorage.getItem("LoginInfo"))
// var init = null;

// const[flag,setFlag]=useState(false);
// const state=mystore.getState().loggedin;
if(JSON.parse(localStorage.getItem("loginInfo"))!=null)
{
     init = {

        uname: JSON.parse(localStorage.getItem("loginInfo")).lid.uname,
        password: JSON.parse(localStorage.getItem("loginInfo")).lid.password,
        role: JSON.parse(localStorage.getItem("loginInfo")).lid.role,

        drivername: JSON.parse(localStorage.getItem("loginInfo")).drivername,
        aregno: JSON.parse(localStorage.getItem("loginInfo")).aregno,
        avehicalno: JSON.parse(localStorage.getItem("loginInfo")).avehicalno,
        email: JSON.parse(localStorage.getItem("loginInfo")).email,
        mono: JSON.parse(localStorage.getItem("loginInfo")).mono,
        website: JSON.parse(localStorage.getItem("loginInfo")).website,
        state: JSON.parse(localStorage.getItem("loginInfo")).state,
        city: JSON.parse(localStorage.getItem("loginInfo")).city,
        pincode: JSON.parse(localStorage.getItem("loginInfo")).pincode,
        landmark: JSON.parse(localStorage.getItem("loginInfo")).landmark,
        availablestatus: JSON.parse(localStorage.getItem("loginInfo")).availablestatus,
        ac_status: JSON.parse(localStorage.getItem("loginInfo")).ac_status,

    }
}
else
{

}


// else
// {
//     init={
//     uname: JSON.parse(localStorage.getItem("loginInfo")).lid.uname,
//     password: JSON.parse(localStorage.getItem("loginInfo")).lid.password,
//     role: JSON.parse(localStorage.getItem("loginInfo")).lid.role,

//     drivername: JSON.parse(localStorage.getItem("loginInfo")).drivername,
//     aregno: JSON.parse(localStorage.getItem("loginInfo")).aregno,
//     avehicalno: JSON.parse(localStorage.getItem("loginInfo")).avehicalno,
//     email: JSON.parse(localStorage.getItem("loginInfo")).email,
//     mono: JSON.parse(localStorage.getItem("loginInfo")).mono,
//     website: JSON.parse(localStorage.getItem("loginInfo")).website,
//     state: JSON.parse(localStorage.getItem("loginInfo")).state,
//     city: JSON.parse(localStorage.getItem("loginInfo")).city,
//     pincode: JSON.parse(localStorage.getItem("loginInfo")).pincode,
//     landmark: JSON.parse(localStorage.getItem("loginInfo")).landmark,
//     availablestatus: JSON.parse(localStorage.getItem("loginInfo")).availablestatus,
//     ac_status: JSON.parse(localStorage.getItem("loginInfo")).ac_status,
//     }
// }



    let AmbulanceProfilePg = () => {

        const [ambulanceuserinfo, setUserInfo] = useReducer(useReducer, init);

        // // const[flag,setFlag]=useState(false);
        // const flag=

        // mystore.subscribe( ()=> { setFlag(mystore.getState().loggedin) } );

        // const[ambusr,setAmbusr]=useState({});
        // setAmbusr( JSON.parse(localStorage.getItem("loginInfo")) )
        const navigate=useNavigate();
        const logout =()=>{

            localStorage.clear();
            navigate("/");
            
            
        }


        return (
            <div>
                <div>

                    <nav className="navbar navbar-expand-xl bg-dark navbar-dark">
                        <ul className="navbar-nav">
                            <li className="nav-item active">
                                <a className="nav-link" href="#">Home</a>
                            </li>
                            {/* <li className="nav-item">
      <a className="nav-link disabled" href="#">Disabled</a>
    </li> */}
                            <li className="nav-item">
                                <a className="nav-link" href="#">Login</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#">Signup</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" onClick={logout}>Logout</a>
                            </li>

                        </ul>
                    </nav>

                </div>
                <div className="formInput container mt-5">
                    <div>
                        <h3>Welcome {ambulanceuserinfo.uname}</h3>

                        <table border={1}>
                            <tr>
                                <td>User Name</td>
                                <td>{ambulanceuserinfo.uname}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Password</td>
                                <td>{ambulanceuserinfo.password}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Driver Name</td>
                                <td>{ambulanceuserinfo.drivername}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Ambulance Registration Number</td>
                                <td>{ambulanceuserinfo.aregno}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Ambulance (RTO) Number</td>
                                <td>{ambulanceuserinfo.avehicalno}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Email</td>
                                <td>{ambulanceuserinfo.email}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Contact Number</td>
                                <td>{ambulanceuserinfo.mono}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Working State</td>
                                <td>{ambulanceuserinfo.state}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Working City</td>
                                <td>{ambulanceuserinfo.city}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Working Area Pincode</td>
                                <td>{ambulanceuserinfo.pincode}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td>Landmark</td>
                                <td>{ambulanceuserinfo.landmark}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                            <tr>
                                <td></td>
                                <td>{ambulanceuserinfo.availablestatus}</td>
                                <td>change</td>
                                {/* <td></td> */}
                            </tr>
                        </table>

                    </div>
                    <div>
                    </div>
                </div>

            </div>
        )

    }
export default AmbulanceProfilePg;
